jobs_results.description:
Динамично развивающаяся Европейская компания, запускает новый проект и ищет таланты для его реализации и последующей поддержки.

У вас есть возможность поработать над совершенно новым продуктом за достойную оплату, с перспективой многолетнего стабильного заработка и карьерного роста.

Трудимся в комфортабельном офисе с удобным расположением, по стандартному графику на испытательном сроке, с возможностью автономной удаленной работы со свободным графиком, по окончанию испытательного срока.

Мы ищем высококлассного разнопланового специалиста, способного выполнить полный цикл работ по реализации мобильных приложений:

- Анализ предметной области, требований и спецификаций и сведение этого в формальное ТЗ;

- Разделение ТЗ на фичи и составление плана разработки по релизам;

- Проектирование архитектуры разрабатываемого продукта;

- Программная реализация бизнес-логики и вспомогательного (работа с БД, сетью и т. д.) функционала;

- Командная работа с дизайнером над созданием GUI;

- Самостоятельное тестирование и отладка разрабатываемых продуктов, прежде чем передавать на проверку QA-инженерам.

Минимальные требования к профессиональной квалификации:

- Кандидат должен понимать особенности архитектур построения приложений MVC, MVVC и VIPER;

- Иметь представление о сетевых протоколах обмена данными - HTTP, TCP, UDP, RTP, STUN.

- Иметь опыт работы с Retrofit, Picasso;

- Уметь отлаживать приложения и искать причины ошибок;

- Идеально знать особенности Java и Android;

Соискателей со следующими навыками и опытом, мы будем рассматривать в первую очередь:

- Фундаментальные знания в программировании (алгоритмы, процедурная и ООП парадигмы, математический базис);

- Умение работать по формальной методологии разработки, с прозрачными результатами и строгими сроками;

- Практическое понимание юзабилити, любовь к простым и удобным интерфейсам — хотя бы с минимальными дизайнерскими навыками, для их реализации;

- Умение самостоятельно тестировать и отлаживать разрабатываемые решения;

- Большой опыт работы с вспомогательными библиотеками (Например: можете быстро разобраться с библиотекой для работы с VPN, для работы со всевозможными API и т. д.);

- Опыт самостоятельной реализации Android-приложения от «идеи до маркета» от 1 шт.;

- Общий опыт в области разработки ПО от 5 лет;

- Высокий уровень профессиональной ответственности.

Для талантливого и опытного профессионала мы предлагаем следующие условия:

- Доход от 2200$ до 4000$ по итогам собеседования (доход Net, - не путать с gross);

- Специально под данный проект сделан комфортный офис в БЦ Riga Land (кухня, релакс зона, графити, прочие приятности). Качественная инфраструктура БЦ: бассейн, фитнесс центр, однако каток(да-да, тот самый, который посещают в коньках), бары, рестораны, шопинг, прочее ;

- Организована доставка сотрудников до офиса от ближайших станций метро (евробусы курсируют более чем регулярно);

- Часть трудовой недели в приятном удаленном формате (творите из дома, без необходимости вялиться в унылых авто и человеко пробках)

- Интернациональный, дружный коллектив состоящий из тщательно отобранных талантов;

- Творческий процесс без бюрократических заморочек и корпоративной шизы;

- Интересные и разнообразные профессиональные задачи;

- Возможность перехода на удаленный формат работы (вы сможете трудиться из любой точки мира, единственные требования: быстрый и надежный интернет канал, своевременное выполнение задач).

-Корпоративный ноутбук, iPhone.

Убедительная просьба: в случае реального соответствия заявленным требованиям к профессиональной квалификации, приложить информативное сопроводительное письмо, всесторонне раскрывающее это самое соответствие.

